const onSubmit = (event) => {
  event.preventDefault();
  const workName = event.target.workName.value;
  const workTime = parseInt(event.target.workTime.value);
  console.log("INPUT VALUE: ", workName, workTime);
  //   event.workName.value;
  //   WorkListTemplate.value
};
export const AddWindow = () => {
  return (
    <form onSubmit={onSubmit}>
      <input type="text" name="workName" placeholder="추가할 작업명"></input>
      <input type="number" name="workTime" placeholder="작업 시간"></input>
      <button type="submit">SUBMIT</button>
    </form>
  );
};
